"""**Part 2:**

Create a point plot showing each author's top 10 books (by average rating), sorted from highest to lowest.  This will help identify which authors are "one hit wonders" and which ones are more consistent across their novels. 

Hints:
*   You will need to sort by `average_rating` **within** each author group. To do this, first write a function called `sort_and_top_10`.  This function will take a pandas dataframe as input, then sort by rating in descending order and grab the top 10 rows only.
*   Next group by `authors`, then use `apply` and pass in your `sort_and_top_10` function to `apply` to sort each author group by the rating.
*   When plotting, use `sns.catplot` and `kind="point"`. 
*  Set `sharey` to False as each chart will have different values on the y-axis (the book titles) so we don't want to share this axis.
*  Use `aspect` to increase the width of the charts to make it more readable

![HW4 - Problem 4.png](data:image/png;base64,)
"""

# function to take in grouped authors and sort by average rating (highest first)
def sort_and_top_10(author):
  sorted_books = author.sort_values("average_rating", ascending=False)
  return sorted_books.head(10)

# group by authors, using the list of top 10 authors
authors_grouped = books_df[books_df["authors"].isin(authors)]
authors_grouped = authors_grouped.groupby(by="authors")

# apply function to sort the function and take top 10 average rated books
# and set index to authors
top_ten_authors_sorted = authors_grouped.apply(sort_and_top_10).set_index("authors")
top_ten_authors_sorted = top_ten_authors_sorted.reset_index()

# rename columns to better names
top_ten_authors_sorted = top_ten_authors_sorted.rename(columns={"average_rating":"Rating",
                                                                "authors":"Author",
                                                                "title":"Title"})
top_ten_authors_sorted

# create multiple graphs showing top authors and their top rated books
sns.set_style("white")
g = sns.catplot(data=top_ten_authors_sorted,
                col='Author', 
                col_wrap=1,
                x="Rating",
                y="Title",
                kind="point",
                sharey=False,
                height=5,
                aspect=2)

"""## Section 4: Create your own visualization
**20 points (15 points for the visual, 5 points for the insight)**

Use this books dataset to create your own visualization of reasonable complexity (aggregate and/or filter the data first, then visualize with seaborn).  Then write 2-3 sentences about the insight gained from your visualization.


"""

# take a data set, see which categories have the most books and which top 10 
# categories have highest average rating over the years
#print(books_df.categories.unique())
counts = books_df['categories'].value_counts()
top_ten_categories = counts.head(10)
#print(top_ten_categories)
top_ten_categories_list = ["Fiction",
                           "Juvenile Fiction",
                           "Biography & Autobiography",
                           "History",
                           "Literary Criticism",
                           "Philosophy",
                           "Comics & Graphic Novels",
                           "Religion",
                           "Drama",
                           "Juvenile Nonfiction"]
# get only rows that contain selected categories
top_categories_df = books_df[books_df['categories'].isin(top_ten_categories_list)]

# create bins for 10 year incriments bins
ten_year_bins = np.arange(1910, 2020, 10)
labels=[]
list_bins = list(np.arange(1910, 2010, 10))

#create list for labels 
for element in list_bins:
  i = str(element)+'s'
  labels.append(i)

# drop books that were published before 1929
top_categories_df = top_categories_df[top_categories_df['published_year'] >= 1919]

# create year bins
top_categories_df['year_bins'] = pd.cut(x=top_categories_df['published_year'], 
                                        bins=ten_year_bins,
                                        labels = labels)

# drop data with rating less than 2
top_categories_df = top_categories_df[top_categories_df['average_rating'] >= 2.0]

# drop data with more than 1000 pages
top_categories_df = top_categories_df[top_categories_df['num_pages'] <= 1000]

# rename columns with more appealing names
top_categories_df = top_categories_df.rename(columns={"average_rating":"Rating",
                                                      "year_bins":"Decades",
                                                      "categories":"Categories"})

top_categories_df.head(5)

# create graph showing most popular literature categories by decades
sns.set_style("white")
sns.set(rc={'figure.figsize':(3,6)})
g = sns.catplot(x="Rating",
                y="Decades",
                data=top_categories_df,
                orient="h",
                height=5,
                aspect=2,
                palette="Set3",
                col="Categories",
#                col_wrap=1,
                sharey=False,
                kind="boxen")

